import React from 'react'
export default class ClickMe extends React.Component {
    constructor(props) {
      super(props)
      this.state = { x: false }
    }
    render() {
      const x = this.state.x

      return (
        <button
          ref='button'
          onClick={() => this.setState({ x: true })}
          onAnimationEnd={() => this.setState({ x: false })}
          className={x ? 'x' : ''}>
          Click me!
        </button>
      )
    }
  }
